  `date_of_birth` datetime DEFAULT NULL,
  `address1` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address2` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
