  `symptoms` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bio` text COLLATE utf8_unicode_ci,
  `speciality` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `degree` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `institution_name` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `language` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `licence` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `national_licence` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `education_details` varchar(2510) COLLATE utf8_unicode_ci DEFAULT NULL,
