  `year` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `certificate_documents` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `facility` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_available` int(11) NOT NULL DEFAULT '0',
  `availability` text COLLATE utf8_unicode_ci,
  `oxitone_id` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL,
  `credit` double NOT NULL DEFAULT '0',
  `commission_perc` double NOT NULL DEFAULT '0',
  `consultation_fee` double NOT NULL DEFAULT '0',
  `course_training` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
