  `professional_cert_no` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `speciality_cert_no` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `app_language` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status_busy` tinyint(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`users_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1179 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
